my $iaddr = inet_aton($host)		# ホスト名をIPアドレスの構造体に変換
    or die \"$hostは存在しないホストです。\\n\";

my $sock_addr = 
    pack_sockaddr_in($port, $iaddr);	# ポート番号とIPアドレスを構造体に変換

